import React from "react";

const Lists = (props) => {
  const { listitems, deleteTask, handleOnChange } = props;

  const handleOnDelete = (task) => {
    deleteTask(task);
  }

  return (
    <div className="toDoData">
      {listitems === "" ?
        <button> no todos</button>
        :
        <div className="data">
          <table></table>
          {
            listitems.map((item, index) => {
              return (
                <div style={{ display: 'flex', alignItem: 'center' }}>
                  <p>
                    <span>
                      <b>
                        <input type="checkbox"  checked={item.status === 'complete'}
                        onClick={(event) => handleOnChange(event, item)}
                         />
                      </b>
                    </span>
                    &nbsp;
                    {item.title}
                  </p>
                  <button
                    onClick={() => handleOnDelete(item)} style={{ height: '30px', margin: 'auto' }}>
                    Delete
                  </button>
                </div>
              )
            })
          }
        </div>
      }
    </div>
  )
}

export default Lists;
